getgenv().connections = {}

getgenv().connect = function(Name, Connection)
	getgenv().connections[Name .. tostring(math.random(1000000, 9999999))] = Connection
	return Connection
end

getgenv().disconnect = function(Name)
	for title, connection in next, getgenv().connections do
		if title:find(Name) == 1 then
			connection:Disconnect()
		end
	end
end

